import React, { useState } from 'react';
import './App.css';
import JournalEntry from './components/JournalEntry';
import JournalList from './components/JournalList';

function App() {
    // Mock journal entries
    const mockEntries = [
        {
            text: "Today I enjoyed a peaceful morning walk in the park. The air was so refreshing!",
            font: "Georgia",
            image: "https://images.unsplash.com/photo-1506744038136-46273834b3fb?auto=format&fit=crop&w=800&q=60"
        },
        {
            text: "Learned some new React tricks today. Feeling productive and motivated!",
            font: "Verdana",
            image: null
        },
        {
            text: "Had a cup of coffee and read a good book. Perfect relaxing evening.",
            font: "Courier New",
            image: "https://images.unsplash.com/photo-1523475496153-3c1d6e3ee1e3?auto=format&fit=crop&w=800&q=60"
        }
    ];

    const [entries, setEntries] = useState(mockEntries);

    const addEntry = (entry) => {
        setEntries([entry, ...entries]);
    };

    return (
        <div className="container">
            <h1>My Serenity Journal</h1>
            <JournalEntry addEntry={addEntry} />
            <JournalList entries={entries} />
        </div>
    );
}

export default App;
